def check_paranthesis(s): 
    stack = [] 

    # Iterate over the given string 
    for i in range(len(s)): 
        # If opening brace, then push it onto stack 
        if s[i] == "(": 
            stack.append(s[i]) 
        # If closing brace, then pop from stack and check if popped 
        # brace is the same as the current closing brace 
        elif s[i] == ")": 
            if len(stack) == 0: 
                return False
            temp = stack.pop()
            if temp != "(": 
                return False
    # Either all opening braces are matched or some opening 
    # braces are unmatched
    return True if len(stack) == 0 else False

