int CountOccurrences(string s, string str, int length) {
    int count = 0;
    int i = 0;
    while (i + length <= s.size()) {
        int j = 0;
        while (j < length && s[i + j] == str[j]) j++;
        if (j==length) count++;
        i++; 
    }
    return count;
